metadata.description:
An equation with two sets of parameters are entangled in a perpetual dance of sound and colour. The underlying concept being that a pair of interplaying notes of colour or sound are needed to interfere with each other and create microtonal harmonies and forms. Also harmony and harmonizing implicitly indicates an interaction, just like a double slit is the minimum required to allow an interference of photons, this piece uses the outputs from two parametric equations to render both sound and colour grids emanating from this process. 

Although each mint is unique, there are nine variations of the visualisations that can be cycled by pressing '1' on keyboard, so in effect all the mints will contain a unique iteration of all the nine modes. 'mouse click to enable sound'

